import React from 'react';
import logo from './logo.svg';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from 'react-router-dom';

function Home() {
  return <h2>Home</h2>
}

function CreateLobby() {
  return <h2>CreateLobby</h2>
}

function Lobby() {
  return <h2>Lobby</h2>
}

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/create-lobby">
          <CreateLobby />
        </Route>
        <Route path="/lobby">
          <Lobby />
        </Route>
        <Route path="/">
          <Home />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
